INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 10001, 0.0, "2023/09/22 14:59:59", "クローチェ", 2002, 1.47, 1, "2023/06/30 12:00:00", "いらっしゃいませっ♪\nキャラバンコインを使って\n買い物ができますよっ！", 126401, 2, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 10002, 0.0, "2023/09/22 14:59:59", "クローチェ", 2002, 2.15, 2, "2023/06/30 12:00:00", "素敵な品が揃ってるので\nたーっくさん買っていって\nくださいねっ♪", 126401, 1, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 10003, 0.0, "2023/09/22 14:59:59", "ライラエル", 2002, 0.0, 2, "2023/06/30 12:00:00", "ショップへようこそ\nキャラバンコインはこちら\nで買い物に使えますよ", 126501, 2, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (1, 10004, 0.0, "2023/09/22 14:59:59", "ライラエル", 2002, 0.0, 1, "2023/06/30 12:00:00", "こちらのショップで\n買い物をして、素敵な\n旅を楽しんでくださいね", 126501, 1, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 10005, 0.0, "2023/12/22 14:59:59", "リンド", 2002, 0.0, 2, "2023/09/15 15:00:00", "いらっしゃいませ\nキャラバンコインを使って\nお買い物ができますよ", 127702, 2, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 10006, 0.0, "2023/12/22 14:59:59", "リンド", 2002, 0.0, 2, "2023/09/15 15:00:00", "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 127702, 2, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 10007, 0.0, "2023/12/22 14:59:59", "ヴルム", 2002, 0.0, 1, "2023/09/15 15:00:00", "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 127802, 1, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (2, 10008, 0.0, "2023/12/22 14:59:59", "ヴルム", 2002, 6.5, 2, "2023/09/15 15:00:00", "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 127802, 1, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (3, 10009, 0.0, "2024/03/22 14:59:59", "アネモネ", 2002, 0.0, 2, "2023/12/15 15:00:00", "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 129602, 1, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (3, 10010, 0.0, "2024/03/22 14:59:59", "アネモネ", 2002, 0.0, 2, "2023/12/15 15:00:00", "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 129602, 1, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (3, 10011, 0.0, "2024/03/22 14:59:59", "ネフィ=ネラ", 2002, 0.0, 1, "2023/12/15 15:00:00", "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 129701, 1, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (3, 10012, 0.0, "2024/03/22 14:59:59", "ネフィ=ネラ", 2002, 6.2, 2, "2023/12/15 15:00:00", "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 129701, 1, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (4, 10013, 0.0, "2024/06/22 14:59:59", "カノン", 2002, 3.1, 3, "2024/03/15 15:00:00", "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 130301, 5, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (4, 10014, 0.0, "2024/06/22 14:59:59", "カノン", 2002, 6.15, 3, "2024/03/15 15:00:00", "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 130301, 2, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (4, 10015, 0.0, "2024/06/22 14:59:59", "ナーナ", 2002, 0.0, 2, "2024/03/15 15:00:00", "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 130401, 2, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (4, 10016, 0.0, "2024/06/22 14:59:59", "ナーナ", 2002, 3.35, 2, "2024/03/15 15:00:00", "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 130401, 1, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (5, 10017, 0.0, "2024/09/22 14:59:59", "ホウオウ", 2002, 0.0, 1, "2024/06/15 15:00:00", "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 130502, 1, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (5, 10018, 0.0, "2024/09/22 14:59:59", "ホウオウ", 2002, 3.18, 2, "2024/06/15 15:00:00", "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 130502, 1, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (5, 10019, 0.0, "2024/09/22 14:59:59", "ホウオウ", 2002, 0.0, 4, "2024/06/15 15:00:00", "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 130503, 4, 3, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (5, 10020, 0.0, "2024/09/22 14:59:59", "ネア", 2002, 4.9, 1, "2024/06/15 15:00:00", "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 123301, 2, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (5, 10021, 0.0, "2024/09/22 14:59:59", "ネア", 2002, 4.8, 1, "2024/06/15 15:00:00", "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 123301, 2, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (6, 10022, 0.0, "2024/12/22 14:59:59", "カリザ", 2002, 4.922, 3, "2024/09/15 15:00:00", "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 133301, 1, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (6, 10023, 0.0, "2024/12/22 14:59:59", "カリザ", 2002, 9.638, 3, "2024/09/15 15:00:00", "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 133301, 5, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (6, 10024, 0.0, "2024/12/22 14:59:59", "ミーア", 2002, 2.88, 1, "2024/09/15 15:00:00", "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 133401, 2, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (6, 10025, 0.0, "2024/12/22 14:59:59", "ミーア", 2002, 4.818, 5, "2024/09/15 15:00:00", "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 133401, 1, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (7, 10026, 0.0, "2025/03/22 14:59:59", "グレイス", 2002, 1.78, 2, "2024/12/15 15:00:00", "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 133002, 1, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (7, 10027, 0.0, "2025/03/22 14:59:59", "グレイス", 2002, 6.15, 1, "2024/12/15 15:00:00", "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 133002, 7, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (7, 10028, 0.0, "2025/03/22 14:59:59", "ヴァイオレット", 2002, 4.28, 6, "2024/12/15 15:00:00", "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 133102, 2, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (7, 10029, 0.0, "2025/03/22 14:59:59", "ヴァイオレット", 2002, 0.0, 1, "2024/12/15 15:00:00", "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 133102, 1, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (8, 10030, 0.0, "2025/06/23 14:59:59", "ルルィ", 2002, 5.53, 2, "2025/03/15 15:00:00", "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 136902, 1, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (8, 10031, 0.0, "2025/06/23 14:59:59", "ルルィ", 2002, 6.05, 9, "2025/03/15 15:00:00", "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", 136902, 7, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (8, 10032, 0.0, "2025/06/23 14:59:59", "デュラン", 2002, 0.0, 2, "2025/03/15 15:00:00", "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", 137001, 1, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (8, 10033, 0.0, "2025/06/23 14:59:59", "デュラン", 2002, 0.0, 2, "2025/03/15 15:00:00", "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", 137001, 1, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (9, 10034, 0.0, "2025/09/23 14:59:59", "サツキ", 2002, 0.0, 2, "2025/06/16 15:00:00", "おう\n好きなもん持ってきな", 135902, 2, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (9, 10035, 0.0, "2025/09/23 14:59:59", "サツキ", 2002, 4.935, 1, "2025/06/16 15:00:00", "宵越しの銭を持つような\n野暮いマネぁしくさんな\nツキが落ちてもしらねぇぜ", 135902, 6, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (9, 10036, 0.0, "2025/09/23 14:59:59", "ユキノ", 2002, 7.441, 2, "2025/06/16 15:00:00", "ら、ら、らっしゃっせ…\nなんかほしいもん、ある？\nか、かき氷とか、ど…？", 135802, 5, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (9, 10037, 0.0, "2025/09/23 14:59:59", "ユキノ", 2002, 0.0, 7, "2025/06/16 15:00:00", "そ、そんな見ねぇで…\nあては、売りもんじゃ\nねぇよ…？", 135802, 7, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (10, 10038, 0.0, "2025/12/22 14:59:59", "クルル", 2002, 2.295, 2, "2025/09/16 15:00:00", "クルルをお求めですかっ？\nそれならお礼に、こちらの\n宝石もどうぞですよ～♪", 130901, 2, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (10, 10039, 0.0, "2025/12/22 14:59:59", "クルル", 2002, 6.281, 1, "2025/09/16 15:00:00", "はっ！　ヒーローさんから\nお代なんて頂けないです！\nどうぞどうぞ…え、ダメ？", 130901, 6, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (10, 10040, 0.0, "2025/12/22 14:59:59", "ヴォルガーノ", 2002, 5.549, 2, "2025/09/16 15:00:00", "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", 137701, 1, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (10, 10041, 0.0, "2025/12/22 14:59:59", "ヴォルガーノ", 2002, 2.64, 3, "2025/09/16 15:00:00", "…リマさんのブロマイド？\n買い取るに決まってらぁ！\nなんでも持ってけ泥棒っ！", 137701, 6, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (11, 10042, 0.0, "2026/03/23 11:59:59", "ライラエル", 2002, 7.642, 7, "2025/12/15 15:00:00", "こ、この格好は…ヴルムが\n集客効果があると言って…\n…本当でしょうか？", 132801, 4, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (11, 10043, 0.0, "2026/03/23 11:59:59", "ライラエル", 2002, 0.0, 1, "2025/12/15 15:00:00", "この我に店番させるとは…\n全て買わねば許さぬぞ\n我が国庫に貢献するが良い", 132802, 1, 2, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (11, 10044, 0.0, "2026/03/23 11:59:59", "クローチェ", 2002, 0.0, 1, "2025/12/15 15:00:00", "アナライズっ！\n本日のオススメ商品は～…\nこちらですっ♪", 134502, 1, 1, -470.0);
INSERT INTO `v1_9d4e2076833faf4dbd3bc3f5e8ccb5c0475d88e4c9203415e5adcb67c9b4cd73` VALUES (11, 10045, 0.0, "2026/03/23 11:59:59", "クローチェ", 2002, 3.72, 2, "2025/12/15 15:00:00", "ギガンティックローチェ、\nおひとついかがですかっ？\n格納庫用意して下さいねっ", 134501, 1, 2, -470.0);
